            <div><img id="logo" src={require('/home/admin1/fundoo/Client/src/assets/Fundoo.png')
           } alt="Fundoo"></img></div>
           <div><h4>Sign in</h4>
           <h5>to continue to Fundoo</h5></div>
           <div id="text-field"><input id={"text1"} type="text" placeholder="name"></input><br/>
           <input id={"text2"} type="password" placeholder="password"></input></div>
           <input type="text" class="form-control" id="validationCustom01" placeholder="First name" value="Mark" required></input>
           </Card>
           </div>
            </div>
        );
    }
}
